import React, {Component} from "react";
import {Dropdown, DropdownButton} from "react-bootstrap";
import * as NavigationLinks from "../../Navigation_Bar/NavigationLinks";

class ServiceDropDownMenu extends Component {
    render() {
        return (
            <DropdownButton title="Services">
                {NavigationLinks.serviceDropDownMenuPageLinks.map(link => (
                    <Dropdown.Item href={link.endpoint}>{link.name}</Dropdown.Item>))}
            </DropdownButton>
        );
    }
}

export default ServiceDropDownMenu;
